import React from "react";
import ReactDOM from "react-dom";

//const element = <h1>Hello!</h1>;

class Kompo extends React.Component {
  constructor(props) {
    super(props);
    this.addActiveClass = this.addActiveClass.bind(this);
    this.state = {
      isActive: false
    };
  }

  addActiveClass() {
    this.setState({
      isActive: true
    });
  }

  klikki(text) {
    this.setState.active({ text: "moi" });
  }
  render() {
    const style = {
      background: "red",
      fontSize: "5px",
      marginTop: "0px"
    };
    return (
      <div>
        {this.state.text}
        <button
          bsSize="small"
          onClick={e => {
            this.klikki("testi");
          }}
        >
          <img src="https://i.warosu.org/data/fa/img/0106/19/1448220270209.png" />
        </button>
      </div>
    );
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
